cy.request('POST', "".concat(Cypress.config('apiUrl'), "/auth/user"), {
  firstName: 'The',
  lastName: 'Goat',
  email: 'theGoat@GOAT.com',
  password: 'Password1!'
}).then(function (response) {
  // response.body is automatically serialized into JSON
  expect(response.body).to.have.property('firstName', 'The'); // true
  cy.request('DELETE', "".concat(Cypress.config('apiUrl'), "/auth/user/").concat(response.body.id)).then(function (deleteRes) {
    expect(deleteRes.status).to.equal(200);
  });
});

